import './App.css';
import { Link } from 'react-router-dom';


function App({children}) {

  return (
    <div className="App">
      <div className="App-header">

        <Link to="/friend-list">
          <button>
          friend List
          </button>
        </Link>
  
      <Link to="/Profile">
          <button>
            Profile
          </button>
        </Link>

      <Link to="/Home">
          <button>
            Home
          </button>
        </Link>
        
     </div>
        <div className="App-content">
        {children}
      </div>
      </div>
  
     
  );
  }
    


export default App;
